import {ThemeProvider} from 'styled-components'

const theme = {
    lightGreen: '#7ed56f',
    mediumGreen: '#55c57a',
    darkGreen: '#28b485',
    lightGrey1:'#f7f7f7'
};



export default function (props) {
    return (<ThemeProvider theme={theme}>
        {props.children}
    </ThemeProvider>)
}
